import './testimonial.css'
import React from 'react'

const Testimonial = () => {
    return (  
        <div className="mb-32">
            <p className="quote text-6xl">Good design is actually a lot harder to notice than poor design, in part because good designs fit our needs so well that the design is invisible</p>
            <p class="name text-5xl mt-8">Don Norman</p>
        </div>
     );
}
 
export default Testimonial;
